import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';

class Register_box extends React.Component {

    render() {
        return (
            <form>
                <div className="form-row" id="dates">
                    <div className="fromDate">
                        <input type="date" className="form-control" placeholder="From date"/>
                    </div>
                    <div className="toDate">
                        <input type="date" className="form-control" placeholder="To date"/>
                    </div>
                </div>

            </form>
        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
